import React, {Component} from 'react';
import '../App.css';
import {Document, Page} from 'react-pdf/dist/entry.webpack';


function Showcase() {

    return (
        <div className='Showcase'>
            <h1>Mobolaji's Resume</h1>
            <Document file = "MobolajiRotibiResume2019.pdf"
            >
                            <Page pageNumber={1} />
            </Document>
        </div>
    );
};

